import React, { Component } from "react";
class RadioInput extends Component {
  state = {};
  render() {
    return (
      <div>
        <input type="radio" id="teacher" name="selection" value="teacher" />
        <input type="radio" id="admin" name="selection" value="admin" />
        <input type="radio" id="student" name="selection" value="student" />
        <input type="radio" id="obecell" name="selection" value="obecell" />
      </div>
    );
  }
}

export default RadioInput;
